import React, { Component } from "react";
import "../Styles/leftnav.css";

class LeftNav extends Component {
  render() {
    return (
      <div className="left-nav">
        <img src="../images/userImg.jpg" alt="user" />
        <p>Left Nav</p>
      </div>
    );
  }
}

export default LeftNav;
